/**
=========================================================
* Soft UI Dashboard PRO React - v2.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/soft-ui-dashboard-pro-material-ui
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
// import Card from "@mui/material/Card";
// import Grid from "@mui/material/Grid";
// import {Link} from 'react-router-dom';
// Soft UI Dashboard PRO React components
// import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

import 'bootstrap/dist/css/bootstrap.min.css';
// import { F } from 'react-bootstrap';
import { Form, Col, Button, Row } from 'react-bootstrap';
// import Userclient from "layouts/dashboards/userclient/Userclient";

function User() {
    return (
        <DashboardLayout>
            <DashboardNavbar />
            <SuiTypography variant="h1" fontWeight="medium" style={{ textAlign: 'center' }}>
                User
            </SuiTypography>
            <br />
            <Row className="mb-3">
                <Form.Group as={Col} controlId="formGridState">
                    <Form.Label>State</Form.Label>
                    <Form.Select defaultValue="Choose...">
                        <option>Choose...</option>
                        <option>...</option>
                    </Form.Select>
                </Form.Group>

                <Form.Group as={Col} className="mb-3" id="formGridCheckbox" style={{margin:'40px'}}>
                    <Form.Check type="checkbox" label="Check me out" />
                </Form.Group>

                <Form.Group as={Col} controlId="formGridCheckbox" style={{margin:'40px'}}>
                    <Form.Check type="checkbox" label="Check me out" />
                </Form.Group>

                <Button as={Col} variant="primary" type="submit">
                    Submit
                </Button>
            </Row>

            <Footer />
        </DashboardLayout>
    );
}

export default User;
